import { useState } from "react";
import image from "./logo.png";

function App() {
  return (
    <div className="App">
      <MainHeader>
        <Logo></Logo>
        <Heading></Heading>
        <Search></Search>
        {/* <LangSelector> </LangSelector> */}
        <SignInPortal />
      </MainHeader>
    </div>
  );
}

export default App;

function MainHeader({ children }) {
  return <nav className="header">{children}</nav>;
}

function Logo() {
  return (
    <span className="logo">
      <img src={image} alt=""></img>
    </span>
  );
}

function Heading() {
  return (
    <header className="">
      <h1 style={{ color: "white" }}>ShopHub•</h1>
      <h1
        style={{
          fontSize: "16px",
          position: "absolute",
          right: "20rem",
          top: "1.45rem",
          fontWeight: "lighter",
          fontFamily: "",
        }}
      >
        Products
      </h1>
    </header>
  );
}

function Search() {
  const [search, setSearch] = useState("");
  return (
    <input
      className="search"
      type="text"
      placeholder="Search here...."
      value={search}
      onChange={(e) => setSearch(e.target.value)}
    ></input>
  );
}

